import './App.scss';


function App() {
  return (
    <div className="App">
      <h1>Hello React Router</h1>
      <Routes>
        <Route path={`/`} element={<Home />} />
        <Route path={`/register/`} element={<Register />} />
        <Route path={`/login/`} element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
